import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import '../css/header/dropdown.css'

const DropDown = () => {

    const [showMenu1, setShowMenu1] = useState(false);
    const [showMenu2, setShowMenu2] = useState(false);
    const [showMenu3, setShowMenu3] = useState(false);
    const [showMenu4, setShowMenu4] = useState(false);
    const [showMenu5, setShowMenu5] = useState(false);
    const [showMenu6, setShowMenu6] = useState(false);
    const [showMenu7, setShowMenu7] = useState(false);

    const handleMouseOver = (menuNumber) => {
        switch (menuNumber) {
            case 1:
                setShowMenu1(true);
              break;
            case 2:
                setShowMenu2(true);
              break;

            case 3:
                setShowMenu3(true);
              break;

            case 4:
                setShowMenu4(true);
              break;

            case 5:
                setShowMenu5(true);
              break;

            case 6:
                setShowMenu6(true);
              break;

            case 7:
                setShowMenu7(true);
              break;
          }
      };

      const handleMouseOut = (menuNumber) => {
        switch (menuNumber) {
            case 1:
                setShowMenu1(false);
              break;
            case 2:
                setShowMenu2(false);
              break;

            case 3:
                setShowMenu3(false);
              break;

            case 4:
                setShowMenu4(false);
              break;

            case 5:
                setShowMenu5(false);
              break;

            case 6:
                setShowMenu6(true);
              break;

            case 7:
                setShowMenu7(false);
              break;
          }
      };

    return (
      <div className="container">
        <div
          className="menu"
          onMouseOver={() => handleMouseOver(1)}
          onMouseOut={() => handleMouseOut(1)}
        >
          <button>선한이웃복지용구</button>
          {showMenu1 && (
            <ul className="dropdown">
              <li>
                <Link to="/electric-bed">전동침대</Link>
              </li>
              <li>
                <Link to="/wheelchair">휠체어</Link>
              </li>
              <li>
                <Link to="/mattress">매트리스</Link>
              </li>
              <li>
                <Link to="/portable-bath">이동욕조</Link>
              </li>
            </ul>
          )}
        </div>
        <div
          className="menu"
          onMouseOver={handleMouseOver}
          onMouseOut={handleMouseOut}
        >
          <button>급여대여</button>
          {showMenu2 && (
            <ul className="dropdown">
              <li>
                <Link to="/electric-bed">전동침대</Link>
              </li>
              <li>
                <Link to="/wheelchair">휠체어</Link>
              </li>
              <li>
                <Link to="/mattress">매트리스</Link>
              </li>
              <li>
                <Link to="/portable-bath">이동욕조</Link>
              </li>
            </ul>
          )}
        </div>
        <div
          className="menu"
          onMouseOver={handleMouseOver}
          onMouseOut={handleMouseOut}
        >
          <button>급여구입</button>
          {showMenu3 && (
            <ul className="dropdown">
              <li>
                <Link to="/electric-bed">전동침대</Link>
              </li>
              <li>
                <Link to="/wheelchair">휠체어</Link>
              </li>
              <li>
                <Link to="/mattress">매트리스</Link>
              </li>
              <li>
